import React from 'react';
import { useNavigate } from 'react-router-dom';

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
      <h1 className="text-3xl font-bold mb-6 text-center">Welcome to Hardware Marketplace</h1>
      <div className="flex flex-col items-center space-y-4 w-full">
        <button
          className="px-6 py-2 bg-blue-500 text-white font-semibold rounded-lg hover:bg-blue-600 w-64"
          onClick={() => navigate('/register')}
        >
          Create Account
        </button>
        <button
          className="px-6 py-2 bg-green-500 text-white font-semibold rounded-lg hover:bg-green-600 w-64"
          onClick={() => navigate('/login')}
        >
          Sign In
        </button>
        <button
          className="px-6 py-2 bg-gray-500 text-white font-semibold rounded-lg hover:bg-gray-600 w-64"
          onClick={() => navigate('/store')}
        >
          Continue as Guest
        </button>
      </div>
    </div>
  );
};

export default HomePage;
